import React, { useState, useEffect } from "react";

const AddFormModal = ({ type, initialData = {}, onSubmit, onClose }) => {
  const [formData, setFormData] = useState({});

  // Initialize form based on type
  useEffect(() => {
    const defaults = {
      property: { name: "", address: "", city: "", state: "", zip: "" },
      tenant: { name: "", email: "", phone: "" },
      unit: { unit_number: "", property_name: "", type: "" },
      lease: { tenant_name: "", unit_number: "", start_date: "", end_date: "" },
      payment: { tenant_name: "", amount: "", date: "" },
    };
    setFormData(initialData || defaults[type] || {});
  }, [type, initialData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ ...formData, id: formData.id || Date.now() });
  };

  // Define fields for each type
  const fields = {
    property: [
      { name: "name", label: "Property Name", type: "text" },
      { name: "address", label: "Address", type: "text" },
      { name: "city", label: "City", type: "text" },
      { name: "state", label: "State", type: "text" },
      { name: "zip", label: "ZIP Code", type: "text" },
    ],
    tenant: [
      { name: "name", label: "Full Name", type: "text" },
      { name: "email", label: "Email", type: "email" },
      { name: "phone", label: "Phone", type: "text" },
    ],
    unit: [
      { name: "unit_number", label: "Unit Number", type: "text" },
      { name: "property_name", label: "Property Name", type: "text" },
      { name: "type", label: "Type (1BHK, 2BHK...)", type: "text" },
    ],
    lease: [
      { name: "tenant_name", label: "Tenant Name", type: "text" },
      { name: "unit_number", label: "Unit Number", type: "text" },
      { name: "start_date", label: "Start Date", type: "date" },
      { name: "end_date", label: "End Date", type: "date" },
    ],
    payment: [
      { name: "tenant_name", label: "Tenant Name", type: "text" },
      { name: "amount", label: "Amount", type: "number" },
      { name: "date", label: "Date", type: "date" },
    ],
  };

  const currentFields = fields[type] || [];

  return (
    <>
      <div style={overlayStyle} onClick={onClose}></div>
      <div style={modalStyle}>
        <h2 style={titleStyle}>Add {type.charAt(0).toUpperCase() + type.slice(1)}</h2>
        <form style={formStyle} onSubmit={handleSubmit}>
          {currentFields.map((field) => (
            <input
              key={field.name}
              name={field.name}
              type={field.type}
              placeholder={field.label}
              value={formData[field.name] || ""}
              onChange={handleChange}
              required
              style={inputStyle}
            />
          ))}
          <div style={buttonContainerStyle}>
            <button type="button" onClick={onClose} style={cancelButtonStyle}>
              Cancel
            </button>
            <button type="submit" style={submitButtonStyle}>
              Save
            </button>
          </div>
        </form>
      </div>
    </>
  );
};

// Styles
const overlayStyle = {
  position: "fixed",
  top: 0,
  left: 0,
  right: 0,
  bottom: 0,
  backgroundColor: "rgba(0,0,0,0.5)",
  zIndex: 999,
};
const modalStyle = {
  position: "fixed",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  background: "#fff",
  padding: "30px",
  borderRadius: "12px",
  boxShadow: "0 8px 20px rgba(0,0,0,0.2)",
  width: "400px",
  zIndex: 1000,
  display: "flex",
  flexDirection: "column",
};
const formStyle = { display: "flex", flexDirection: "column", gap: "12px" };
const inputStyle = {
  padding: "10px 12px",
  borderRadius: "6px",
  border: "1px solid #ccc",
  fontSize: "14px",
  outline: "none",
};
const titleStyle = { marginBottom: "20px", color: "#333" };
const buttonContainerStyle = {
  display: "flex",
  justifyContent: "flex-end",
  gap: "10px",
  marginTop: "20px",
};
const submitButtonStyle = {
  padding: "10px 20px",
  backgroundColor: "#007bff",
  color: "#fff",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer",
};
const cancelButtonStyle = {
  padding: "10px 20px",
  backgroundColor: "#f0f0f0",
  color: "#333",
  border: "none",
  borderRadius: "6px",
  cursor: "pointer",
};

export default AddFormModal;
